import React, {Component} from 'react';

class Home extends Component {
    render() {
        return (
            <div>
                <h1>HOME</h1>
                <ul>
                    <li>
                        <i className="fab fa-github-square"/>
                    </li>
                    <li>
                        <i className="fab fa-linkedin"/>
                    </li>
                    <li>
                        <i className="fab fa-twitter-square"/>
                    </li>
                </ul>




            </div>
        );
    }
}

export default Home;
